, module: {
    loaders: [
      { test: /\.jsx?$/
      , loaders: ['babel']
      , include: path.join(__dirname, 'src')
      }
    , { test: /\.scss$/
      , loaders: [
          'style-loader'
        , 'css-loader?modules&-autoprefixer&importLoaders=1&localIdentName=[local]___[hash:base64:5]'
        , 'postcss-loader'
        , 'sass-loader'
        ]
      , include: path.join(__dirname, 'src')
      }
    ]
  }
}
